/*Table structure for table `gongzuorizhi` */

DROP TABLE IF EXISTS `gongzuorizhi`;

CREATE TABLE `gongzuorizhi` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `addtime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `biaoti` varchar(30) NOT NULL COMMENT '标题',
  `leixing` varchar(30) NOT NULL COMMENT '类型',
  `gongzuoneirong` longtext COMMENT '工作内容',
  `riqi` date DEFAULT NULL COMMENT '日期',
  `gonghao` varchar(30) DEFAULT NULL COMMENT '工号',
  `jiaoshixingming` varchar(30) DEFAULT NULL COMMENT '教师姓名',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=58 DEFAULT CHARSET=utf8 COMMENT='工作日志';

